import React from 'react';
import Navbar from '../navbar/navbar';
import Layout from '../layout/layout'


class Home extends React.Component {
    constructor(){
        super();
        this.state = {
            username: '',
           password: '',
           latitude: 0,
           longitude: 0,
           photo: '',
           food: '',
           gender: '',
           age: 0,
           redirect: false
        }

    }



  render() {
      console.log('Login state', this.state);
      console.log('userData', this.props.userData);
      const profilePic = this.props.userData.photo;
    return (
        <Layout>
            <Navbar />
            <div class="container">
              <h3>Profile Page</h3>
              <div style={{'border':'1px solid black', 'padding': '10px'}}>
              <img style={{'height':'200px', 'width':'200px', 'border':'1px solid black'}} src={profilePic} alt="fail to load" />
              </div>
              <p>{this.props.userData.username}</p>
              <p>{this.props.userData.photo}</p>
              <p>{this.props.userData.food}</p>
              <p>{this.props.userData.gender}</p>
              <p>{this.props.userData.age}</p>
            </div>
        </Layout>
    );
  }
}

export default Home;
